  return "<!-- first block -->\n<div class=\"first-block\">\n</div>\n<!-- #crumbs for page title bar and top navigation -->\n<div id=\"crumbs\" class=\"black dark\">\n	<div class=\"row large\">\n		<!-- page title/statement -->\n		<div class=\"six columns\">\n			<h6 class=\"sub-heading\"><a id=\"return-home\"><span>INICIO</span></a>&nbsp; / &nbsp; <a id=\"go-blog\"><span>ÚLTIMOS POST</span></a>&nbsp; / &nbsp;IDENTIDAD DE MARCA</h6>\n		</div>\n		<div class=\"six columns text-right\">\n			<!-- post navigation -->\n			<ul class=\"icon-nav\">\n				<li><a class=\"ttp_tooltip fo\" id=\"view_blog_fotografia\" data-title=\"Fotografía\"><i class=\"fa fa-arrow-left\"></i></a></li>\n				<li><a class=\"ttp_tooltip blg\" id=\"go-blog\" data-title=\"Blog\"><i class=\"fa fa-th-list\"></i></a></li>\n				<li><a class=\"ttp_tooltip agby\" id=\"view_blog_ads_google_bing_yahoo\" data-title=\"Ads Google, Bing, Yahoo!\"><i class=\"fa fa-arrow-right\"></i></a></li>\n			</ul>\n		</div>\n	</div>\n</div>\n<section class=\"grey stripe-bg\">\n<!-- post content -->\n<div class=\"two-third\">\n	<div id=\"single-post\">\n		<!-- post container -->\n		<ul class=\"grid alt-posts\" id=\"posts\">\n			<!-- begin post -->\n			<li class=\"post\">\n			<!-- post  img header -->\n			<div class=\"post-img\">\n				<img src=\"img/blog/b3large.jpg\" alt=\"post-img-anthem\"/>\n			</div>\n			<div class=\"post-info\">\n				<!-- post title -->\n				<h1 class=\"grid-title\">IDENTIDAD DE MARCA</h1>\n				<div class=\"post-meta\">\n					<span>Categoría: <span><i class=\"mif mif-ps-bg-branding\" style=\"font-size: 19px; position: relative; top: 5px; padding-right: 5px;\"></i> BRANDING</span></span>\n				</div>\n				<div class=\"post-content\">\n					<p>\n						La imagen corporativa es un factor de fundamental importancia para el posicionamiento de una empresa, ya que debe atraer la atención, ser fácil de comprender, expresar credibilidad y confianza, ser coherente con los objetivos de negocio y traducir claramente  los atributos intangibles de la compañía, bajo estos conceptos entonces será fácil de recordar y en consecuencia el posicionamiento de la empresa será sólido y duradero.\n					</p>\n					<!-- content image -->\n					<!--<figure class=\"content-img\">-->\n						<!-- lightbox link --><!--\n						<a class=\"do_popup\" rel=\"prettyPhoto\" href=\"preview/b4.jpg\" title=\"image title\"><i class=\"fa fa-arrows\"></i></a>\n						<img src=\"preview/b4.jpg\"/>\n						<figcaption>\n							Content Image Caption - In enim justo, rhoncus ut, imperdiet a, venenatis vitae, justo. Nullam dictum felis eu pede mollis pretium.\n						</figcaption>\n					</figure>-->\n					<h4 class=\"purple-text\">Diseño de imagen corporativa</h4>\n					<p>\n						Apoyamos a nuestros clientes a definir los atributos de marca y de imagen corporativa, desde la creación de un logotipo, eslogan, hasta la aplicación  en diversos materiales de comunicación tales como en tarjetas de presentación, hojas membretadas, facturas, carpetas, folders, entre otros.\n					</p>\n					<h4 class=\"purple-text\">Manual de control de imagen corporativa o identidad visual.</h4>\n					<p>\n						es un compendio de lineamientos y políticas para el uso y aplicación correcta del logotipo, que puede ser a través de papelería y materiales de comunicación, acondicionamientos de producto, de embalaje, uniformes y vehículos, con el fin de lograr una coherencia  con la expresión de la marca y consistencia con los medios de comunicación.\n					</p>\n				</div>\n			</div>\n			</li>\n		</ul>\n	</div>\n</div>\n<!-- sidebar -->\n<aside class=\"one-third grey\">\n<div id=\"sidebar\">\n	<!-- category widget -->\n	<div class=\"widget\">\n		<!--<h5 class=\"stripe-heading\">BLOG CATEGORIES</h5>\n		<div class=\"widget-content\">\n			<ul class=\"categories\">\n				<li><a href=\"../not_found.html\"><i class=\"mif mif-ps-ad-advertising\" style=\"font-size: 19px; position: relative; top: 5px; padding-right: 20px;\"></i> WEB ADS</a></li>\n				<li><a href=\"../not_found.html\"><i class=\"mif mif-ps-sm-social-media\" style=\"font-size: 19px; position: relative; top: 5px; padding-right: 20px;\"></i> SOCIAL MEDIA</a></li>\n				<li><a href=\"../not_found.html\"><i class=\"mif mif-ps-ws-web-services\" style=\"font-size: 19px; position: relative; top: 5px; padding-right: 20px;\"></i> WEB SERVICES</a></li>\n				<li><a href=\"../not_found.html\"><i class=\"mif mif-ps-em-email-marketing\" style=\"font-size: 19px; position: relative; top: 5px; padding-right: 20px;\"></i> E-MAIL MARKETING</a></li>\n				<li><a href=\"../not_found.html\"><i class=\"mif mif-ps-bg-branding\" style=\"font-size: 19px; position: relative; top: 5px; padding-right: 20px;\"></i> BRANDING</a></li>\n				<li><a href=\"../not_found.html\"><i class=\"mif mif-ps-fa-fotografia\" style=\"font-size: 19px; position: relative; top: 5px; padding-right: 20px;\"></i> FOTOGRAFÍA</a></li>\n			</ul>\n		</div>-->\n	</div>\n	<!-- recent posts widget -->\n	<div class=\"widget\">\n		<h5 class=\"stripe-heading\">ENTRADAS RECIENTES</h5>\n		<div class=\"widget-content\">\n			<ul class=\"recent-posts\">\n				<li><a id=\"view_blog_posicionamiento_web\">Posicionamiento Web</a></li>\n				<li><a id=\"view_blog_fotografia\">Fotografía</a></li>\n				<li><a id=\"view_blog_identidad_de_marca\">Identidad de Marca</a></li>\n				<li><a id=\"view_blog_ads_google_bing_yahoo\">Ads Google, Bing y Yahoo!</a></li>\n				<li><a id=\"view_blog_web_analytics\">Web Analytics</a></li>\n			</ul>\n		</div>\n	</div>\n</div>\n</aside>\n<!-- clear floats -->\n<div class=\"clear\">\n</div>\n</section>";
