templates['temp_content_notes'] = template({"compiler":[6,">= 2.0.0-beta.1"],"main":function(depth0,helpers,partials,data) {
  return "<!-- begin notes -->\n<section class=\"grey stripe-bg\">\n	<div class=\"two-third\">\n		<!-- begin posts -->\n		<ul class=\"grid alt-posts\" id=\"posts\">\n			<!-- post -->\n			<li class=\"post\">\n			<!-- post image -->\n			<div class=\"post-img\">\n				<img src=\"img/blog/b5large.jpg\" alt=\"post-img-anthem\"/>\n			</div>\n			<div class=\"post-info\">\n				<!-- read more button -->\n				<a id=\"view_blog_posicionamiento_web\" title=\"Read Post\">\n				<h1 class=\"grid-title\">POSICIONAMIENTO WEB</h1>\n				</a>\n				<div class=\"post-meta\">\n					<span>Categoría: <span><i class=\"mif mif-ps-ws-web-services mif-2x\" style=\"font-size: 19px; position: relative; top: 5px; padding-right: 5px;\"></i> WEB SERVICES</span></span>\n				</div>\n				<div class=\"post-content\">\n					<p class=\"intro\">\n						Creamos soluciones de marketing online diseñadas para que usted obtenga más clientes y por consiguiente más ventas. Sabemos de la importancia de las visitas a su sitio Web, ya que además de ser agradable y contener información oportuna, es necesario también que tenga tráfico orientado al producto o servicio que se ofrece.\n					</p>\n					<p class=\"intro\">\n						Aproximadamente el 15% del tráfico en su sitio llega de forma directa, es decir que el usuario pone en su navegador www.suempresa.com; así también un 5% proviene de otros vínculos ligados a su sitio y el 80% proviene de motores de búsqueda como Google, Yahoo y MSN, entre otros.\n					</p>\n					<!-- read more button -->\n					<a id=\"view_blog_posicionamiento_web\" class=\"icon-button\">Leer Más<i class=\"fa fa-chevron-right\"></i></a>\n				</div>\n			</div>\n			</li>\n			<!-- post -->\n			<li class=\"post\">\n			<!-- post image -->\n			<div class=\"post-img\">\n				<img src=\"img/blog/b2large.jpg\" alt=\"post-img-anthem\"/>\n			</div>\n			<div class=\"post-info\">\n				<!-- read more button -->\n				<a id=\"view_blog_fotografia\" title=\"Read Post\">\n				<h1 class=\"grid-title\">FOTOGRAFÍA</h1>\n				</a>\n				<div class=\"post-meta\">\n					<span>Categoría: <span><i class=\"mif mif-ps-fa-fotografia mif-2x\" style=\"font-size: 19px; position: relative; top: 5px; padding-right: 5px;\"></i> FOTOGRAFÍA</span></span>\n				</div>\n				<div class=\"post-content\">\n					<p class=\"intro\">\n						Fotografía profesional con un equipo humano y tecnológico de primer nivel.\n\n						Fotografía en locación.\n						Retoque fotográfico (restauración, montaje, efectos, etc.)\n						Fotografía publicitaria.\n						Fotografía de productos.\n\n						Banco de imágenes (más de 10,000 fotografías del medio veterinario y agropecuario)\n					</p>\n					<!-- read more button -->\n					<a id=\"view_blog_fotografia\" class=\"icon-button\">Leer Más<i class=\"fa fa-chevron-right\"></i></a>\n				</div>\n			</div>\n			</li>\n			<!-- post -->\n			<li class=\"post\">\n			<!-- post image -->\n			<div class=\"post-img\">\n				<img src=\"img/blog/b3large.jpg\" alt=\"post-img-anthem\"/>\n			</div>\n			<div class=\"post-info\">\n				<!-- read more button -->\n				<a id=\"view_blog_identidad_de_marca\" title=\"Read Post\">\n				<h1 class=\"grid-title\">IDENTIDAD DE MARCA</h1>\n				</a>\n				<div class=\"post-meta\">\n					<span>Categoría: <span><i class=\"mif mif-ps-bg-branding mif-2x\" style=\"font-size: 19px; position: relative; top: 5px; padding-right: 5px;\"></i> BRANDING</span></span>\n				</div>\n				<div class=\"post-content\">\n					<p class=\"intro\">\n						La imagen corporativa es un factor de fundamental importancia para el posicionamiento de una empresa, ya que debe atraer la atención, ser fácil de comprender, expresar credibilidad y confianza, ser coherente con los objetivos de negocio y traducir claramente  los atributos intangibles de la compañía, bajo estos conceptos entonces será fácil de recordar y en consecuencia el posicionamiento de la empresa será sólido y duradero.\n					</p>\n					<!-- read more button -->\n					<a id=\"view_blog_identidad_de_marca\" class=\"icon-button\">Leer Más<i class=\"fa fa-chevron-right\"></i></a>\n				</div>\n			</div>\n			</li>\n			<!-- post -->\n			<li class=\"post\">\n			<!-- post image -->\n			<!--<div class=\"post-img\">\n				<img src=\"img/blog/b6large.jpg\" alt=\"post-img-anthem\"/>\n			</div>-->\n			<div class=\"post-video\">\n				<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/gl0zNdou7-Y\" frameborder=\"0\" allowfullscreen></iframe>\n			</div>\n			<div class=\"post-info\">\n				<!-- read more button -->\n				<a id=\"view_blog_ads_google_bing_yahoo\" title=\"Read Post\">\n				<h1 class=\"grid-title\">Ads Google, Bing y Yahoo!</h1>\n				</a>\n				<div class=\"post-meta\">\n					<span>Categoría: <span><i class=\"mif mif-ps-ad-advertising mif-2x\" style=\"font-size: 19px; position: relative; top: 5px; padding-right: 5px;\"></i> WEB ADS</span></span>\n				</div>\n				<div class=\"post-content\">\n					<p class=\"intro\">\n						El equipo de Medigraf define las estrategias de marketing en motores de búsqueda, realizando una investigación de keywords, crea y administra una cuenta de Adwords con una campaña de marketing en buscadores en base a un trabajo que se desarrolla con seguimiento mensual en base a las estadísticas.\n					</p>\n					<!-- read more button -->\n					<a id=\"view_blog_ads_google_bing_yahoo\" class=\"icon-button\">Leer Más<i class=\"fa fa-chevron-right\"></i></a>\n				</div>\n			</div>\n			</li>\n			<!-- post -->\n			<li class=\"post\">\n			<!-- post image -->\n			<div class=\"post-img\">\n				<img src=\"img/blog/b7large.jpg\" alt=\"post-img-anthem\"/>\n			</div>\n			<div class=\"post-info\">\n				<!-- read more button -->\n				<a id=\"view_blog_web_analytics\" title=\"Read Post\">\n				<h1 class=\"grid-title\">Web Analytics</h1>\n				</a>\n				<div class=\"post-meta\">\n					<span>Categoría: <span><i class=\"mif mif-ps-ws-web-services mif-2x\" style=\"font-size: 19px; position: relative; top: 5px; padding-right: 5px;\"></i> WEB ADS</span></span>\n				</div>\n				<div class=\"post-content\">\n					<p class=\"intro\">\n						Ofrece información agrupada del tráfico que llega a los sitios web según la audiencia, la adquisición, el comportamiento y las conversiones que se llevan a cabo en el sitio web.\n					</p>\n					<!-- read more button -->\n					<a id=\"view_blog_web_analytics\" class=\"icon-button\">Leer Más<i class=\"fa fa-chevron-right\"></i></a>\n				</div>\n			</div>\n			</li>\n		</ul>\n		<!-- end posts -->\n		<!-- notes navigation -->\n		<!--<div class=\"post-nav grey\">\n			<div class=\"row\">\n				<div class=\"eight columns\">\n					<ul class=\"pagination\">\n						<li class=\"current\"><a href=\"#\">1</a></li>\n						<li class=\"\"><a href=\"#\">2</a></li>\n						<li class=\"\"><a href=\"#\">3</a></li>\n						<li class=\"\"><a href=\"#\">4</a></li>\n						<li class=\"\"><a href=\"#\">5</a></li>\n						<li class=\"\"><a href=\"#\">6</a></li>\n					</ul>\n				</div>\n				<div class=\"four columns text-right smalltoppadding\">\n					<ul class=\"icon-nav\">\n						<li><a href=\"\">Next Page &nbsp; <i class=\"fa fa-arrow-right\"></i></a></li>\n					</ul>\n				</div>\n			</div>\n		</div>-->\n	</div>\n	<!-- sidebar -->\n	<aside class=\"one-third grey\">\n		<div id=\"sidebar\">\n			<!-- category widget -->\n			<!--<div class=\"widget\">\n				<h5 class=\"stripe-heading\">CATEGORÍAS</h5>\n				<div class=\"widget-content\">\n					<ul class=\"categories\">\n						<li><a href=\"not_found.html\"><i class=\"mif mif-ps-ad-advertising\" style=\"font-size: 19px; position: relative; top: 5px; padding-right: 20px;\"></i> WEB ADS</a></li>\n						<li><a href=\"not_found.html\"><i class=\"mif mif-ps-sm-social-media\" style=\"font-size: 19px; position: relative; top: 5px; padding-right: 20px;\"></i> SOCIAL MEDIA</a></li>\n						<li><a href=\"not_found.html\"><i class=\"mif mif-ps-ws-web-services\" style=\"font-size: 19px; position: relative; top: 5px; padding-right: 20px;\"></i> WEB SERVICES</a></li>\n						<li><a href=\"not_found.html\"><i class=\"mif mif-ps-em-email-marketing\" style=\"font-size: 19px; position: relative; top: 5px; padding-right: 20px;\"></i> E-MAIL MARKETING</a></li>\n						<li><a href=\"not_found.html\"><i class=\"mif mif-ps-bg-branding\" style=\"font-size: 19px; position: relative; top: 5px; padding-right: 20px;\"></i> BRANDING</a></li>\n						<li><a href=\"not_found.html\"><i class=\"mif mif-ps-fa-fotografia\" style=\"font-size: 19px; position: relative; top: 5px; padding-right: 20px;\"></i> FOTOGRAFÍA</a></li>\n					</ul>\n				</div>\n			</div>-->\n			<!-- recent posts widget -->\n			<div class=\"widget\">\n				<h5 class=\"stripe-heading\">ENTRADAS RECIENTES</h5>\n				<div class=\"widget-content\">\n					<ul class=\"recent-posts\">\n						<li><a id=\"view_blog_posicionamiento_web\">Posicionamiento Web</a></li>\n						<li><a id=\"view_blog_fotografia\">Fotografía</a></li>\n						<li><a id=\"view_blog_identidad_de_marca\">Identidad de Marca</a></li>\n						<li><a id=\"view_blog_ads_google_bing_yahoo\">Ads Google, Bing y Yahoo!</a></li>\n						<li><a id=\"view_blog_web_analytics\">Web Analytics</a></li>\n					</ul>\n				</div>\n			</div>\n		</div>\n	</aside>\n	<!-- clear floats -->\n	<div class=\"clear\">\n	</div>\n</section>";
  },"useData":true});
